//Command
Command::Command(string s) {
    char tmp[200];
    int t = 0;
    for (int i = 0;i < s.size();i++) {
        if (s[i] == ' ' || s[i] == ';') {
            if (t != 0) {
                tmp[t] = '\0';
                t = 0;
                args.push_back(tmp);
            }
        }
        else {
            tmp[t++] = s[i];
        }
    }
}

void Command::print() {
    for (string arg : args) {
        cout << arg << ",";
    }
    cout << endl;
}

