SynAnalyzer::SynAnalyzer(NonTerminal* start, vector<Generator*>& gens) {
    //
    stack_state[0] = 0;
    stack_t = 1;
    //
    this->gens = gens;
    this->start = start;
    initFirstSet(gens);
    initFollowSet(start, gens);
    // printFirstSet();
    // printFollowSet();
    getLR1();
}

void SynAnalyzer::initFirstSet(vector<Generator*>& gens) {
    //FIRST
    while (1) {
        bool isChange = false;//
        //for 1
        for (Generator* gen : gens) {
            string left = gen->left->name;
            bool all_empty = true;//
            //for 2
            for (GeneratorItem* item : gen->right) {//
                //FIRST
                if (item->type == "ter") {
                    all_empty = false;//
                    isChange |= FirstSet[left].insert(item->c_ter->name).second;//
                    break;
                }
                //FIRST
                else if (item->type == "non") {//
                    bool hasEmpty = false;
                    //for 3
                    for (string ter : FirstSet[item->c_non->name]) {//FIRST
                        if (ter == "empty") {//
                            hasEmpty = true;//
                        }
                        else {
                            isChange |= FirstSet[left].insert(ter).second;//
                        }
                    }
                    //for 3 end
                    if (!hasEmpty) {
                        all_empty = false;
                        break;//
                    }
                }
                else if (item->type == "act") {//
                    continue;
                }
            }
            //for 2 end
            //
            if (all_empty) {
                isChange |= FirstSet[left].insert("empty").second;
            }
        }
        //for 1 end
        if (!isChange)break;
    }
}

void SynAnalyzer::printFirstSet() {
    cout << "-----------------------------------------\nFIRST:\n";
    for (auto item : FirstSet) {
        cout << item.first << ":";
        for (string first : item.second) {
            cout << first << ", ";
        }
        cout << endl;
    }
    cout << "-----------------------------------------\n";
}

set<string> SynAnalyzer::getFirst(Generator* gen, int s) {
    set<string> ans;
    bool all_empty = true;
    for (int i = s;i < gen->right.size();i++) {
        GeneratorItem* item = gen->right[i];
        if (item->type == "act") {
            continue;
        }
        else if (item->type == "ter") {
            ans.insert(item->c_ter->name);
            all_empty = false;
            break;
        }
        else if (item->type == "non") {
            bool hasEmpty = false;
            //for 1
            for (string ter : FirstSet[item->c_non->name]) {
                if (ter != "empty") {
                    ans.insert(ter);
                }
                else {
                    hasEmpty = true;
                }
            }
            //for 1 end
            if (!hasEmpty) {
                all_empty = false;
                break;
            }
        }
    }
    if (all_empty) {
        ans.insert("empty");
    }
    return ans;
}

void SynAnalyzer::initFollowSet(NonTerminal* start, vector<Generator*> gens) {
    //FOLLOW
    FollowSet[start->name].insert("$");
    while (1) {
        bool isChanged = false;
        //for 1
        for (Generator* gen : gens) {
            //for 2
            for (int i = 0;i < gen->right.size();i++) {
                if (gen->right[i]->type == "non") {
                    set<string> afterFIRST = getFirst(gen, i + 1);
                    bool hasEmpty = false;
                    //FIRST
                    for (string ter : afterFIRST) {
                        if (ter == "empty") {
                            hasEmpty = true;
                        }
                        else {
                            isChanged |= FollowSet[gen->right[i]->c_non->name].insert(ter).second;
                        }
                    }
                    //
                    if (hasEmpty) {
                        for (string ter : FollowSet[gen->left->name]) {
                            isChanged |= FollowSet[gen->right[i]->c_non->name].insert(ter).second;
                        }
                    }
                }
            }
        }
        if (!isChanged) break;
    }
}

